import React from "react";
import "./Navbar.css";
import home from "../Assets/Navbar/Home.png";
import Basket from "../Assets/Navbar/Basket.png";
import Heart from "../Assets/Navbar/Heart.png";
import search from "../Assets/Navbar/Search.png";
import User from "../Assets/Navbar/User.png";

function Navbar() {
  return (
    <div className="Navbar">
      <ul>
        <li>
          <i class="fa fa-home" aria-hidden="true"></i>
        </li>
        <li>
          <img src={search} alt="Home" />
        </li>
        <li>
          <img src={Basket} alt="Home" />
        </li>
        <li>
          <img src={Heart} alt="Home" />
        </li>
        <li>
          <img src={User} alt="Home" />
        </li>
      </ul>
    </div>
  );
}

export default Navbar;
